import React, { useEffect } from "react";
import WebFont from "webfontloader";

function App() {
  useEffect(() => {
    WebFont.load({
      google: {
        families: ["Public Sans"],
      },
    });
  }, []);

  return <div className="App">We are ready to begin.</div>;
}

export default App;
